// Dashboard.js
import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/Dashboard.css';

function Dashboard() {
  return (
    <div className="dashboard-container">
      <h1>GROW IMPRESS</h1>
      <p>Your personal growth journey starts here. Learn, grow, and impress.</p>

      <div className="sections">
        <Link to="/how-to" className="section">
          <img src="/path/to/flower-icon1.png" alt="How To" />
          <p>HOW TO SECTION</p>
        </Link>
        <Link to="/stories" className="section">
          <img src="/path/to/flower-icon2.png" alt="Stories of Inspiration" />
          <p>STORIES OF INSPIRATION</p>
        </Link>
        <Link to="/resources" className="section">
          <img src="/path/to/flower-icon3.png" alt="Resources" />
          <p>RESOURCES</p>
        </Link>
      </div>

      <div className="chatbot-icon" onClick={() => openChatbot()}>
        <img src="/path/to/chatbot-icon.png" alt="Chatbot" />
      </div>
    </div>
  );
}

function openChatbot() {
  alert("Chatbot coming soon!");
}

export default Dashboard;
